import * as React from "react";

const { id } = useParams();
import { useParams } from "react-router-dom";

function Instruction(props) {
  return (
    <div>
      Instruction
      <a
        href={`/instruction/${props.id}`}
        style={{
          border: "2px solid #e26c40",
          padding: "1%",
          color: "#e26c40",
          borderRadius: "20%",
          textDecoration: "none",
          marginBottom: "2%",
        }}
        id={props.id}
        name="Start"
      >
        Start
      </a>
    </div>
  );
}

export default Instruction;
